import React from "react";
import PropTypes from "prop-types";
import { connect } from "react-redux";
import { logoutUser } from "../../actions/authActions";
import Article from "../dashboard/Article";



class Home extends React.Component {

  render() {
    const { user } = this.props.auth;
    return (
      <div class="AllCon">
            <div class="TopBar">
              <span>
                <b><p>Hello, {user.name.split(" ")[0]} Are you ready?</p></b>
              </span>
             </div>

        <div class="ExerciseBoxCon">

          <div class="bannerCon">
            <img src="/uploads/plank.png" alt="..." style={{width: "300px"}} class="homeBanner" />
            <p class="bannerTitle" >MISFits Help You Fitness at Home</p>
          </div>

            <h3 class="hTitle">Popular Workouts</h3>
            <Article />
        </div>
      </div>
    );
  }
}
Home.propTypes = {
  logoutUser: PropTypes.func.isRequired,
  auth: PropTypes.object.isRequired,
};
const mapStateToProps = (state) => ({
  auth: state.auth,
});

export default connect(mapStateToProps, { logoutUser })(Home);
